import React from 'react';
const Books = [
    {
        title:'Mais Pesado que o ceu',
        author: 'Charles R. Cross',
        price: '25.80',
        read: 'no'
    },
    {
        title: 'A culpa é das estrelas',
        author: 'John Green',
        price: '19.90',
        read: 'yes'
    }
];

function BooksToRead(){
    return(
        <div className="pa4">
            <div className="overflow-auto">
                <table className="f6 w-100 mw8 center" cellSpacing="0">
                    <thead>
                    <tr className="stripe-dark">
                        <th className="fw6 tl pa3 bg-white">Title</th>
                        <th className="fw6 tl pa3 bg-white">Author</th>
                        <a className="f6 link dim br-pill ba ph3 pv2 mb2 dib light-purple" href="#0">Button Text</a>
                    </tr>

                    </thead>
                    <tbody className="lh-copy">

                    <tr className="stripe-dark">
                        <td className="pa3">{Books[0].title}</td>
                        <td className="pa3">{Books[0].author}</td>
                    </tr>

                    <tr className="stripe-dark">
                        <td className="pa3">{Books[1].title}</td>
                        <td className="pa3">{Books[1].author}</td>
                    </tr>


                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default BooksToRead;
